import {NavDropDown, Nav, Container, Navbar} from 'react-bootstrap';
import { useEffect } from 'react';
import puppy from '../img/puppy.png';
import  '../css/ComponentOne.css';


const One =()=> {
    useEffect (()=>{
        document.getElementById('puppy').style.backgroundImage = `url(${puppy})`;
    });
    return(
        <Container className='d-flex'>

            <div className='not-only'>
                <h2>Not only people need a home</h2>

            </div>
            <div id='puppy' style={{height: '528px', width: '498px', backgroundRepeat: 'no-repeat', backgroundSize: 'cover'}}>
            
            </div>
        </Container>
    );
}
export default One;
